import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import HOST from "../Setup";

import "../bootstrap.css";

function ViewProfessorDetails(props) {
  const professor = props.professor;
  return (
    <div>
      <h3 align="center">Professor derails:</h3>
      <br />

      <table className="table">
        <tbody>
          <tr>
            <td>Firstname:</td>
            <td>{professor.firstname}</td>
          </tr>
          <tr>
            <td>Lastname:</td>
            <td>{professor.lastname}</td>
          </tr>
          <tr>
            <td>Academic title:</td>
            <td>{professor.academicTitle}</td>
          </tr>
          <tr>
            <td>Sex:</td>
            <td>{professor.sex}</td>
          </tr>
        </tbody>
      </table>

      <br />
      <h4 align="center">Courses: </h4>
      <br />

      <table className="table">
        <thead>
          <tr>
            <th scope="col">Course name</th>
            <th scope="col">Course code</th>
          </tr>
        </thead>
        <tbody>
          {professor.courses.map((e, i) => (
            <tr key={i}>
              <td>{e.name}</td>
              <td>{e.courseCode}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

function ProfessorDetails(props) {
  const [professorDetails, setProfessorDetails] = useState(null);
  const [loading, setLoading] = useState(true);
  const { id } = useParams();

  useEffect(() => {
    let url = HOST + "/professors/" + id;

    console.log(url);

    fetch(url)
      .then((response) => {
        response.json().then((result) => {
          setProfessorDetails(result);
          console.log(professorDetails);
        });
      })
      .finally(() => {
        setLoading(false);
      });
  }, []);

  return (
    <div>
      <h3>
        {professorDetails && (
          <ViewProfessorDetails professor={professorDetails} />
        )}
      </h3>
    </div>
  );
}

export default ProfessorDetails;
